                    <div className="w-16 bg-gray-700 rounded-full h-1.5 mr-2">
                      <div className="bg-green-500 h-1.5 rounded-full w-full"></div>
                    </div>
                    <span className="text-green-400 text-xs font-medium">99.9%</span>
                  </div>
